import React, {Component} from 'react';
import {DashboardLogo, DashboardNavigationWrapper, NavigationList} from "../styled/Dashboard.styled";
import PressLogo from "../assets/temp_dashboard_logo.png"

function DashboardNavigation() {
        return (
            <DashboardNavigationWrapper>
                <DashboardLogo src={PressLogo}/>
                <NavigationList>
                    <li>T</li>
                </NavigationList>
            </DashboardNavigationWrapper>
        );
}

export default DashboardNavigation;
